import React, { useState } from "react";

function Navigation() {
  return (
    <header className="header-container">
      <nav className="navigation-wrapper">
        <ul className="navigation-item">
          <li>
            <a href="#">Home</a>
          </li>
          <li>
            <a href="#">About</a>
          </li>
          <li>
            <a href="#">Recipes</a>
          </li>
          <li>
            <a href="#">Contact</a>
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default Navigation;

//font-family: 'Puppies Play', cursive;
